INSERT INTO `code` (`code_id`, `member_id`, `strategy`, `public`, `description`, `tempt_code`, `file_name`) VALUES
(1, 3, 'KD', 1, '', '', '3_KD'),
(3, 5, 'KDCross', 0, 'KDCross 是技术分析中的一种交易信号策略，主要基于 KD 指标的交叉来判断买入或卖出的时机。KD 指标是由随机指标 (Stochastic Oscillator) 演变而来的技术分析工具，包含 K 值和 D 值两条曲线。', 'from backtesting import Backtest, Strategy\nfrom backtesting.lib import crossover\n# 定義策略\nclass strategy(Strategy):\n    lower_bound = 20\n    upper_bound = 80\n\n    def init(self):\n        self.k = self.I(lambda: self.data[\'K\'], name=\'K\')\n        self.d = self.I(lambda: self.data[\'D\'], name=\'D\')\n\n    def next(self):\n        if crossover(self.k, self.d) and self.k[-1] < self.lower_bound and self.d[-1] < self.lower_bound and not self.position:\n            self.buy()\n        elif crossover(self.d, self.k) and self.k[-1] > self.upper_bound and self.d[-1] > self.upper_bound:\n            if self.position and self.position.is_long:\n                self.position.close()\n\n# 計算 KD 指標\ndef calculate(df, period=9, signal_period=3):\n    df = df.copy()\n    high_max = df[\'High\'].rolling(window=period).max()\n    low_min = df[\'Low\'].rolling(window=period).min()\n    df[\'RSV\'] = 100 * ((df[\'Close\'] - low_min) / (high_max - low_min))\n    df[\'K\'] = df[\'RSV\'].ewm(alpha=1/signal_period).mean()\n    df[\'D\'] = df[\'K\'].ewm(alpha=1/signal_period).mean()\n    return df\n\ndef name():\n    return \'KDCross\'\n\nif __name__ == \'__main__\':\n    calculate()', '5_KDCross'),
(6, 5, 'RSI', 0, 'RSI超買超賣策略\n我的策略是使用相對強弱指數（RSI）來判斷市場的超買和超賣狀況。\n當RSI低於30時，市場進入超賣區，進行買入；當RSI高於70時，市場進入超買區，進行賣出。', 'from backtesting import Backtest, Strategy\nclass strategy(Strategy):\n    oversold_level = 30\n    overbought_level = 70\n\n    def init(self):\n        # 初始化 RSI 指標\n        self.rsi = self.I(lambda: self.data[\'RSI\'], name=\'RSI\')\n\n    def next(self):\n        # 當 RSI 低於超賣水平且沒有持倉時，買入\n        if self.rsi[-1] < self.oversold_level and not self.position:\n            self.buy()\n        # 當 RSI 高於超買水平且持有多頭倉位時，平倉\n        elif self.rsi[-1] > self.overbought_level:\n            if self.position and self.position.is_long:\n                self.position.close()\n\n# 計算 RSI 指標\ndef calculate(df, period=14):\n    df = df.copy()\n    # 計算價格變動的差異\n    delta = df[\'Close\'].diff()\n    # 計算上漲和下跌的平均值\n    gain = (delta.where(delta > 0, 0)).rolling(window=period).mean()\n    loss = (-delta.where(delta < 0, 0)).rolling(window=period).mean()\n    # 計算 RSI\n    rs = gain / loss\n    df[\'RSI\'] = 100 - (100 / (1 + rs))\n    return df\n\ndef name():\n    return \"RSI\"\n\nif __name__ == \"__main__\":\n    calculate()', '5_RSI'),
(16, 5, 'KD', 0, '', 'from backtesting import Backtest, Strategy\nfrom backtesting.lib import crossover\n# 定義策略\nclass strategy(Strategy):\n    lower_bound = 20\n    upper_bound = 80\n\n    def init(self):\n        self.k = self.I(lambda: self.data[\'K\'], name=\'K\')\n        self.d = self.I(lambda: self.data[\'D\'], name=\'D\')\n\n    def next(self):\n        if crossover(self.k, self.d) and self.k[-1] < self.lower_bound and self.d[-1] < self.lower_bound and not self.position:\n            self.buy()\n        elif crossover(self.d, self.k) and self.k[-1] > self.upper_bound and self.d[-1] > self.upper_bound:\n            if self.position and self.position.is_long:\n                self.position.close()\n\n# 計算 KD 指標\ndef calculate(df, period=9, signal_period=3):\n    df = df.copy()\n    high_max = df[\'High\'].rolling(window=period).max()\n    low_min = df[\'Low\'].rolling(window=period).min()\n    df[\'RSV\'] = 100 * ((df[\'Close\'] - low_min) / (high_max - low_min))\n    df[\'K\'] = df[\'RSV\'].ewm(alpha=1/signal_period).mean()\n    df[\'D\'] = df[\'K\'].ewm(alpha=1/signal_period).mean()\n    return df\n\ndef name():\n    return \'KD\'\n\nif __name__ == \'__main__\':\n    calculate()', '5_KD');
